from datetime import datetime
import re

def parse_iso8601(date_str, delimiter='T', timezone=None):
    try:
        if '+' in date_str or '-' in date_str:
            delimiter = '+' if '+' in date_str else '-'
            date_str, timezone = date_str.split(delimiter)
            timezone = delimiter + timezone
        elif 'Z' in date_str:
            date_str = date_str.replace('Z', '+0000')
            timezone = '+0000'
        date_time = datetime.strptime(date_str, '%Y-%m-%d' + delimiter + '%H:%M:%S')
        timestamp = int(date_time.timestamp())
        return str(timestamp) + timezone
    except:
        return None
